import React from "react";

import AccessAlarmIcon from '@material-ui/icons/AccessAlarm';


function Note(props) {

  function handleclick(){
  props.ondelete(props.id);
  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleclick}><AccessAlarmIcon/></button>
    </div>
  );
}

export default Note;
